import React, {useState} from 'react';
import './Realizations.css'
import { gsap, Power1 } from "gsap";

function Realizations() {

const buttonsValue =[">" ,"<"]
  return (
      <section className="realization"  id="realizations">

        <div className="realization__current">
          <div className="realization__currentText">THERE WILL BE CURR TEXT</div>
          <div className="realization__currentImage">THERE WILL BE CURR IMAGE</div>
        </div>

        <div className="realization__next">
          <div className="realization__nextImage">THERE WILL BE NEXT IMAGE</div>
          <div className="realization__nextText"> THERE WILL BE NEXT TEXT</div>
          <div className="realization__nextButtons">
            <div className="realization__nextButton realization__nextButton--next"><span>{buttonsValue[0]}</span></div>
            <div className="realization__nextButton realization__nextButton--prev"><span>{buttonsValue[1]}</span></div>
          </div>
        </div>

     </section>
  );
}

export default Realizations;
